import {
  Button,
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
  DialogTitle,
  TextField,
} from "@mui/material";
import PropTypes from "prop-types";
import React from "react";
import { SchrijfInRequest } from "PropagandaSysteem/src/ApplicationLayer/Organisatie/OrganisatieRequests";
import { Categorie } from "PropagandaSysteem/src/DomainLayer/Enums/Categorie";
import { SchrijfIn } from "PropagandaSysteem/src/ApplicationLayer/Organisatie/OrganisatieUseCases";
import ApplicationState from "PropagandaSysteem/src/ApplicationLayer/ApplicationState";

export default function AddInschrijvingModal(props: any) {
  const [open, setOpen] = React.useState(false);
  const [schrijfInRequest, setSchrijfInRequest] = React.useState<
    SchrijfInRequest | undefined
  >({
    voornaam: "Nieuw",
    achternaam: "Inschrijving",
    club: "KCCM",
    categorie: Categorie.ASP_H,
    individueleWedstrijden: [
      {
        wedstrijd: "K1_1000",
        rondes: ["heat"],
      },
    ],
  });
  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleSave = () => {
    console.log(SchrijfIn(schrijfInRequest!, ApplicationState.getInstance()));
  };

  return (
    <div>
      <Button variant="outlined" onClick={handleClickOpen}>
        Add Inschrijving
      </Button>
      <Dialog open={open}>
        <DialogContent>
          <DialogContentText>
            Fill in the form to create a new race!
          </DialogContentText>
          <TextField
            autoFocus
            margin="dense"
            id="raceTitle"
            label="race Title"
            type="text"
            fullWidth
            variant="standard"
          />
          <TextField
            autoFocus
            margin="dense"
            id="raceDistance"
            label="race Distance"
            type="text"
            fullWidth
            variant="standard"
          />
          <TextField
            autoFocus
            margin="dense"
            id="boatType"
            label="boat Type"
            type="text"
            fullWidth
            variant="standard"
          />
          <TextField
            autoFocus
            margin="dense"
            id="aantalBanen"
            label="Aantal Banen"
            type="text"
            fullWidth
            variant="standard"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleSave}>Save</Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}

AddInschrijvingModal.propTypes = {
  onAddMenu: PropTypes.func,
};
